let todayDia
let nextTrain
let interval
let today //true:holiday,false:weekday
let debugTime

//debugTime = "Mar 11 2019 11:59:55 GMT+0900 (JST)"
//setInterval(()=>{
//  let a = new Date(debugTime)
//  a.setSeconds(a.getSeconds()+1)
//  debugTime = a.toString()
//},1000)

const setup = ()=>{
  clearInterval(interval)
  nextTrain = {"up":0,"down":0}
  let nowTime = debugTime?new Date(debugTime):new Date()
  let day = nowTime.getDay()
  if(nowTime.getHours()<3){
    if(day==0) day = 7
    day--
  }
  if(today){
    todayDia = holiday
  }else{
    todayDia = weekday
  }
  if(today===undefined) if(1<=day && day<=5){
    todayDia = weekday
    today = false
  }else{
    todayDia = holiday
    today = true
  }
  $("#today").text(`本日は${today?"休日":"平日"}ダイヤです`)
  intervalFunction()
  //1分ごとに繰り返し
  let nextFindTime = debugTime?new Date(debugTime):new Date()
  nextFindTime.setMinutes(nextFindTime.getMinutes()+1)
  nextFindTime.setSeconds(1)
  nextFindTime.setMilliseconds(0)
  setTimeout(()=>{
    intervalFunction()
    interval = setInterval(()=>{
      intervalFunction()
    },60000)
  },nextFindTime.getTime()-nowTime.getTime())
  //明日3時に再度セットアップ
  let nextSetupTime = debugTime?new Date(debugTime):new Date()
  if(2<nowTime.getHours())nextSetupTime.setDate(nextSetupTime.getDate()+1)
  nextSetupTime.setHours(3)
  nextSetupTime.setMinutes(0)
  nextSetupTime.setSeconds(0)
  nextSetupTime.setMilliseconds(0)
  setTimeout(()=>{
    today = undefined
    setup()
  },nextSetupTime.getTime()-nowTime.getTime())
}
const intervalFunction = ()=>{
  $(".display").each((i,data)=>{
    $(data).css("background-color","black")
    $(data).text("")
  })
  findNextTrain("up")
  findNextTrain("down")
//  console.log(todayDia.up[nextTrain.up])
//  console.log(todayDia.down[nextTrain.down])
  $(".serviceUp").each((i,data)=>{
    if(!todayDia.up[nextTrain.up+i])return false
    $(data).text(todayDia.up[nextTrain.up+i].service)
    switch(todayDia.up[nextTrain.up+i].service){
      case "普通":
        $(data).css("background-color","black")
      break
      case "✈急行":
        $(data).css("background-color","blue")
      break
      case "特急":
        $(data).css("background-color","red")
      break
    }
  })
  $(".laststopUp").each((i,data)=>{
    if(!todayDia.up[nextTrain.up+i])return false
    $(data).text(todayDia.up[nextTrain.up+i].laststop)
//    $(data).text("品  川")
  })
  $(".timeUp").each((i,data)=>{
    if(!todayDia.up[nextTrain.up+i])return false
    $(data).text(todayDia.up[nextTrain.up+i].time)
  })
  //下り
  $(".serviceDown").each((i,data)=>{
    if(!todayDia.down[nextTrain.down+i])return false
    $(data).text(todayDia.down[nextTrain.down+i].service)
    switch(todayDia.down[nextTrain.down+i].service){
      case "普通":
        $(data).css("background-color","black")
      break
      case "✈急行":
        $(data).css("background-color","blue")
      break
      case "特急":
        $(data).css("background-color","red")
      break
    }
  })
  $(".laststopDown").each((i,data)=>{
    if(!todayDia.down[nextTrain.down+i])return false
    $(data).text(todayDia.down[nextTrain.down+i].laststop)
  })
  $(".timeDown").each((i,data)=>{
    if(!todayDia.down[nextTrain.down+i])return false
    $(data).text(todayDia.down[nextTrain.down+i].time)
  })
}
const findNextTrain = (going)=>{
  while(true){
    if(!todayDia[going][nextTrain[going]])break
    let tmp = todayDia[going][nextTrain[going]].time.split(":")
    tmp = {hours:tmp[0],minutes:tmp[1]}
    let scopeTrainTime = debugTime?new Date(debugTime):new Date()
    if(scopeTrainTime.getHours()<3)scopeTrainTime.setDate(scopeTrainTime.getDate()-1)
    scopeTrainTime.setHours(tmp.hours)
    scopeTrainTime.setMinutes(tmp.minutes)
    let stationTime = debugTime?new Date(debugTime):new Date()
//    stationTime.setMinutes(stationTime.getMinutes()+5)
    if(scopeTrainTime.getTime()<stationTime.getTime()){
      nextTrain[going]++
    }else{
      break
    }
  }
}
setup()
$("#today").click(function(){
  today = !today
  setup()
})
const addZero = num=>{
  return (num+"").length===1 ? "0"+num : num
}
const clock = ()=>{
  let nowTime = debugTime?new Date(debugTime):new Date()
  $("#clockYear").text(nowTime.getFullYear())
  $("#clockMonth").text(addZero(nowTime.getMonth()+1))
  $("#clockDate").text(addZero(nowTime.getDate()))
  $("#clockHours").text(addZero(nowTime.getHours()))
  $("#clockMinutes").text(addZero(nowTime.getMinutes()))
  $("#clockSeconds").text(addZero(nowTime.getSeconds()))
}
const setClock = ()=>{
  clock()
  let nowTime = debugTime?new Date(debugTime):new Date()
  setTimeout(()=>{
    setInterval(()=>{
      clock()
    },1000)
  },1000-nowTime.getMilliseconds())
}
setClock()

let audio = new Audio()
audio.src = "./chime.mp3"
setInterval(()=>{
  let nowTime = debugTime?new Date(debugTime):new Date()
  if((nowTime.getHours()===12||nowTime.getHours()===0) && nowTime.getMinutes()===0 && nowTime.getSeconds()===0){
    if(!$("#muteCheckBox:checked").val()){
      audio.play()
    }
  }
},1000)



$("#settingOpen").click(function(){
  $("#popupArea").toggle(200)
})
$("#popupCloseButton").click(function(){
  $("#popupArea").toggle(200)
})

let intervalSystem = null
$("#intervalSystemButton").click(function(){
  clearInterval(intervalSystem)
  if($("#intervalSystemButton").val()==="stop"){
    $("#intervalSystemButton").val("go")
    return
  }else{
    let time = $("#intervalSystemNumberMin").val()*1000*60+$("#intervalSystemNumberSec").val()*1000
    $("#intervalSystemButton").val("stop")
    intervalSystem = setInterval(()=>{
    audio.play()
    },time)
  }
})